import React, {Component} from "react"

import { makeStyles } from '@material-ui/core/styles';
import Link from '@material-ui/core/Link';
import {Link as RouterLink} from "react-router-dom"
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles((theme) => ({
    root: {
        '& > * + *': {
            marginLeft: theme.spacing(2),
        },
    },
}));

export default function Links() {
    const classes = useStyles();
    const preventDefault = (event) => event.preventDefault();


    return (
        <Typography className={classes.root}>
            <Link component={RouterLink} to="/" onClick={preventDefault}>Home</Link>
            <Link component={RouterLink} to="/comedians"  onClick={preventDefault}>All Comedians</Link>
            <Link component={RouterLink} to="/login" onClick={preventDefault}>Login</Link>
            <Link component={RouterLink} to="/profile" onClick={preventDefault}>Profile</Link>
        </Typography>
    );
}

